// IsSolid checks if a block ID is solid
func IsSolid(id int) bool {
	return IsSolidMap[id]
}

// GetHardness returns the hardness of a block
func GetHardness(id int) float64 {
	if h, ok := HardnessMap[id]; ok {
		return h
	}
	return -1.0
}
